              <div class="stl_01" style="top: 33.3713em; left:9.8317em;"><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0142em;">第一步：通过 </span><span class="stl_14 stl_12 stl_23" style="word-spacing:-0.0142em;">IE</span><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0142em;">浏览器访问 </span><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_24 stl_25 stl_23" style="word-spacing:-0.0142em;">www.jzt2025.com </span></a><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0142em;">进入极智通 </span></a><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_14 stl_12 stl_23" style="word-spacing:-0.0142em;">2025</span></a><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0142em;">云管</span></a><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0142em;">理平台，选择远程 </span><span class="stl_14 stl_12 stl_23" style="word-spacing:-0.0142em;">PLC &nbsp;</span></div>
              <div class="stl_01" style="top: 34.9113em; left:6.322em;z-index:281; "><span class="stl_11 stl_12 stl_26" style="word-spacing:0.0481em;">连接的 </span><span class="stl_14 stl_12 stl_26" style="word-spacing:0.0481em;">SS700</span><span class="stl_11 stl_12 stl_26" style="word-spacing:0.0481em;">，点击右边齿轮再点击“开始远程维护”。 &nbsp;</span></div>
              <div class="stl_01" style="top: 43.8129em; left:7.482em;z-index:330; "><span class="stl_11 stl_12 stl_27" style="word-spacing:0.0511em;">※第二步：打开台达 </span><span class="stl_14 stl_12 stl_27" style="word-spacing:0.0511em;">PLC</span><span class="stl_11 stl_12 stl_27" style="word-spacing:0.0511em;">编程软件 </span><span class="stl_14 stl_12 stl_27" style="word-spacing:0.0511em;">WPLSoft</span><span class="stl_11 stl_12 stl_27" style="word-spacing:0.0511em;">，先点击左边通信设置菜单下的“</span><span class="stl_14 stl_12 stl_27" style="word-spacing:0.0511em;">Ethernet</span><span class="stl_11 stl_12 stl_27" style="word-spacing:0.0511em;">”； &nbsp;</span></div>
